  private Route findRoute(Coordinate startLocation, Coordinate goalLocation,
    Cost cost, Heuristic heuristic) throws Exception {
    CustomRoutingParameters routingParameters=new CustomRoutingParameters();
    routingParameters.setStartLocation(startLocation);
    routingParameters.setGoalLocation(goalLocation);
    routingParameters.setCost(cost);
    routingParameters.setHeuristic(heuristic);
    return routingService.findRoute(routingParameters);
  }

